import React from "react";
import "./sidebaroption.css"

export default function SidebarOption({ icon }) {
    return(
        <button>
            <IconContext.Provider value={{ className: "sidebar-option", size: 35 }}>
                <>
                    {React.createElement(icon, {size:20})}
                </>
            </IconContext.Provider>
        </button>
    )
}
